apiVersion: operators.coreos.com/v1alpha1
kind: ClusterServiceVersion
metadata:
  annotations:
    alm-examples: '[]'
    capabilities: Basic Install
  name: purple-storage-rh-operator.v0.0.0
  namespace: placeholder
spec:
  apiservicedefinitions: {}
  customresourcedefinitions:
    owned:
    - description: PurpleStorage is the Schema for the purplestorages API
      displayName: Purple Storage
      kind: PurpleStorage
      name: purplestorages.purple.purplestorage.com
      specDescriptors:
      - description: MachineConfig labelling for the installation of kernel-devel
          package
        displayName: Custom Mco
        path: mco_config
      - description: Version of IBMs installation manifests found at https://github.com/IBM/ibm-spectrum-scale-container-native
        displayName: Ibm Cnsa Version
        path: ibm_cnsa_version
      - displayName: Cluster
        path: ibm_cnsa_cluster
      - description: Boolean to create the CNSA cluster object
        displayName: Create
        path: ibm_cnsa_cluster.create
        x-descriptors:
        - urn:alm:descriptor:com.tectonic.ui:booleanSwitch
      - description: Nodes with this label will be part of the cluster, must have
          at least 3 nodes with this
        displayName: Daemon Node Selector
        path: ibm_cnsa_cluster.daemon_nodeSelector
        x-descriptors:
        - urn:alm:descriptor:com.tectonic.ui:fieldDependency:ibm_cnsa_cluster.create:true
      - description: Labels to be used for the machineconfigpool
        displayName: Mco Labels
        path: mco_config.mco_labels
      version: v1alpha1
  description: Purple Storage Setup
  displayName: Purple Storage
  icon:
  - base64data: 
    mediatype: image/png
  install:
    spec:
      deployments: null
    strategy: ""
  installModes:
  - supported: false
    type: OwnNamespace
  - supported: false
    type: SingleNamespace
  - supported: false
    type: MultiNamespace
  - supported: true
    type: AllNamespaces
  keywords:
  - gpfs
  - purple
  - storage
  links:
  - name: Purple Storage Rh Operator
    url: https://purple-storage-rh-operator.domain
  maintainers:
  - email: michele@acksyn.org
    name: mbaldessari
  - email: aeros@redhat.com
    name: darkdoc
  maturity: alpha
  minKubeVersion: 1.23.0
  provider:
    name: Purple Team
  version: 0.0.0
